import React from "react";
import PropTypes from "prop-types";

const id = ({ getProfileById, match, profile: { profile, loading }, auth }) => {
  useEffect(() => {
    getProfileById(match.params.id);
  }, [getProfileById, match.params.id]);

  return <div>test</div>;
};

id.propTypes = {};

export default id;
